ae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, s modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?</span></p>\r\n','','2011-12-15 08:37:14','2012-06-18 01:42:37','2012-06-18 01:42:37',0),(14,5,18,'published','10 BIG MYTHS ON LOSING WEIGHT','<p>\r\n	<span style=\"font-size:16px;\">Myths are popular beliefs that are not founded on truth but are embraced by many simply because they have become part of a practice or tradition.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">In health and fitness, there are certain beliefs and practices, especially about losing weight, that have been enshrined as gospel truth but which are actually just myths.&nbsp; Unfortunately, despite scientific advances and vast resources for gathering and sharing information, many of them are still being observed, which keeps a lot of people from getting the full benefits of a good weight loss program.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Check out how much you really know of the 10 biggest myths about losing weight</span></p>\r\n<ol>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>All calories are created equal.&nbsp;</em></strong> Not true &ndash; if your intention is to lose weight. Calories from one food group, say sugar, may be equal in numerical value to those of another food group such as carbohydrates &ndash; but not in terms of individual metabolism.&nbsp; If eating sweets, for example, causes your blood sugar to rise, then you are likely to store more fat than someone with less reaction to sugar intake.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>Eating puffed rice cakes is good for your diet.</em></strong>&nbsp; This is downright false.&nbsp;&nbsp; Rice is carbohydrates.&nbsp; If you eat too much puffed rice and fail to burn it with exercise, then it turns into sugar, which signals your body to produce more fat.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>No pain, no gain.&nbsp;</strong></em> This is so common you can almost hear it reverberating in the gyms.&nbsp; It implies subjecting your body to pain to achieve a certain degree of fitness level, which is certainly a myth.&nbsp;&nbsp; While you certainly feel some discomfort after a workout, this does not mean pain in the ugly sense of the word.&nbsp; Real pain could come in the form of an injury, which is a cause for real alarm; not from easy-to-ignore sore muscles resulting from an ordinary exercise routine. &nbsp;</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>Losing weight is difficult.</em></strong>&nbsp;&nbsp; Unhealthy eating habits and inactive, passive lifestyle are two of the main causes of obesity.&nbsp; It&rsquo;s easy to lose weight if you focus on manageable targets at a time, like losing 1-2 pounds a week over a reasonable timeline.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Secret fad diets help you lose weight.&nbsp; </strong></em>Yes, they will, at least temporarily.&nbsp; In the long run, however, fad diets lose their effect and can only make you crave for more food than you normally do. Once you start, you will begin a cycle where the net effect is more pounds for you.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Certain foods can burn fat and cause you to lose weight.</strong></em>&nbsp; It may be true that some foods help increase your metabolism, but practically all foods have calories, which need to be burned by the body.&nbsp; It&rsquo;s absurd for anyone to claim to have lost weight for eating something.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>You can eat anything and still lose wait.&nbsp;</em></strong> This is far more radical than the sixth myth for the same reason.&nbsp; Wishful thinking.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>A vegetarian diet helps you lose weight.&nbsp; </strong></em>A vegetarian diet is a lifestyle choice for religious, cultural, and other reasons, but it&rsquo;s not a weight loss diet.&nbsp; Whether you&rsquo;re on a vegetable diet or not, you can still be overweight if you don&rsquo;t maintain a balanced, moderate diet.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>Counting calories is important.&nbsp;&nbsp;</em></strong> It may be enough to know the general caloric content of certain foods, but keeping track of how many calories you eat everyday is a bit extreme.&nbsp;&nbsp; If you need to ask yourself if a Big Mac is going to make you exceed your caloric limit, then you may have problem there.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Exercise and a healthy diet will help you lose weight. </strong></em>Before you ask why this is part of the list, let&rsquo;s qualify.&nbsp; This is gospel truth, and not myth, only if you practice it.&nbsp; No amount of knowledge will slim you down if you don&rsquo;t practice what you know.</span></li>\r\n</ol>\r\n<p>\r\n	<span style=\"font-size:16px;\">Achieving your desired weight and fitness level is a state of mind.&nbsp; More than exercise and eating healthy, it&rsquo;s important to have the right mental state to keep your body slimmer, healthier, and more physically fit for as long as you live.</span></p>\r\n','/post_img/','2011-12-15 08:41:16','2012-07-04 04:45:29',NULL,1),(15,5,18,'published','10 COMMON WORKOUT ERRORS','<p>\r\n	<span style=\"font-size:16px;\">Your main reason for working out in a gym is to improve your level of physical fitness.&nbsp; However, you may be guilty of committing some of the very common workout mistakes that hinder you from achieving your fitness goals. While some of these mistakes may be slight, most of them will not only slow down your progress, but can lead to injuries as well.</span></p>\r\n<ol>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Not warming up and stretching.</strong></em> Whether you&rsquo;re into aerobics or weightlifting, your muscles need to be warmed and stretched properly for at least 15 minutes before working out to avoid injuries.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Not pushing yourself &nbsp;hard enough.</strong></em> You do need to, if you want to see results. If you lack intensity during training, you slow down your progress. Be sure that you are working intensely enough by not chatting during a set or not taking long rests between exercises. Focus on your form and on working every muscle for full contraction.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Not drinking enough water. </strong></em>Get yourself hydrated before, during and after a workout. Not enough water in your system can impair your workout performance which can lead to diminished strength and endurance, muscle cramps and other problems.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Not working out each muscle adequately. </strong></em>Instead of hopping from machine to machine in a single workout, plan which muscles you have to work on each day. Spend enough time exercising a particular muscle group at a machine to develop strength and stamina, even if it means using just a few machines each session.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>Not starting with the right weights. </em></strong>To prevent your muscles from wearing down, start by lifting lighter weights and doing just a few reps. Once your muscles get used to this level, you can take on a heavier set and more reps.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>Making up for missed workouts. </em></strong>Overdoing a single workout session to compensate for the absence of exercise for the rest of the week can put a lot of unneeded stress on your body.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Not breathing properly. </strong></em>Improper breathing deprives your muscles of much-needed oxygen. Proper breathing involves inhaling through your nose, filling your lungs with air, and exhaling through your mouth.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Not getting the right workout. </strong></em>If you&rsquo;re just staring, work with a personal fitness coach who can tailor workouts for your specific needs as well as teach you how to properly perform them on exercise machines.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><em><strong>Losing motivation. </strong></em>Your drive to remain fit may wear off after a time. Be sure to have short and long term goals to help you stay motivated. You won&rsquo;t get the desired results unless you&rsquo;re absolutely certain of what you want.</span><br />\r\n		&nbsp;</li>\r\n	<li>\r\n		<span style=\"font-size:16px;\"><strong><em>Not having fun during exercise. </em></strong>A fitness program should be fun and not stressful. As in any endeavor in life, you should find joy in what you do to succeed.</span></li>\r\n</ol>\r\n<p>\r\n	<span style=\"font-size:16px;\"><span style=\"color:#000000;\"><font class=\"Apple-style-span\" face=\"arial\">These workout errors are indeed so common that they are oftentimes overlooked, but they make a major impact in the success or failure of your fitness program.&nbsp;</font></span></span></p>\r\n','/post_img/','2011-12-15 08:41:35','2012-07-04 04:45:18',NULL,1),(16,5,15,'published','Test','<p>\r\n	<span style=\"color: rgb(62, 62, 62); font-family: arial; line-height: 22px; \">Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, s modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?</span></p>\r\n','','2012-05-23 21:00:58','2012-06-18 01:42:30','2012-06-18 01:42:30',0),(17,5,16,'published','Test','<p>\r\n	<span style=\"color: rgb(62, 62, 62); font-family: arial; line-height: 22px; \">Sed ut perspiciatis unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam, eaque ipsa quae ab illo inventore veritatis et quasi architecto beatae vitae dicta sunt explicabo. Nemo enim ipsam voluptatem quia voluptas sit aspernatur aut odit aut fugit, s modi tempora incidunt ut labore et dolore magnam aliquam quaerat voluptatem. Ut enim ad minima veniam, quis nostrum exercitationem ullam corporis suscipit laboriosam, nisi ut aliquid ex ea commodi consequatur? Quis autem vel eum iure reprehenderit qui in ea voluptate velit esse quam nihil molestiae consequatur, vel illum qui dolorem eum fugiat quo voluptas nulla pariatur?</span></p>\r\n','/post_img/microsite-csvimport.png','2012-05-23 21:01:05','2012-06-18 01:42:26','2012-06-18 01:42:26',0),(18,5,15,'published','USING THE RIGHT PROTEIN FOR GOOD HEALTH','<p>\r\n	<span style=\"font-size:16px;\">Athletes and bodybuilders are always on the lookout for the best food supplement that can boost their performance and growth. Just step inside a health store and you&rsquo;ll be greeted by a slew of products containing protein.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Many bodybuilders around the world have discovered that high-protein intake enhances performance and muscle development. High-protein diets can raise positive nitrogen status that promotes growth when combined with rigid strength training. Proteins from the diet contain essential and non-essential amino acids needed for cellular and muscle growth.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">While a standard shake may contain various forms of protein, there are five types of protein that bodybuilders prefer to use. Each has its own particular advantages and disadvantages and some are more preferred than others.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Egg protein is the most notable of all proteins and the leading standard by which other proteins are judged. It is very expensive, and 100% concentrated egg protein is difficult to find. Egg protein is easily digested and absorbed in the system but its amino acid profile isn&rsquo;t as strongly effective as the others.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Whey protein is the most common source of protein, and is used in a larger number of products sold in stores today. Like egg protein, it is digested easily and loaded with essential amino acids as well as Branched Chains Amino Acids that are essential for muscle-building. Some whey-only supplements come with higher lactose levels that make them more difficult to digest and can cause bloating.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Casein is protein derived from milk. Its distinctive characteristic is that it takes longer to digest and assimilate. This makes it ideal as a nighttime protein as it will be absorbed by the muscle during sleep. Casein is slightly behind whey in its muscle-building properties.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Genus protein comes from yellow pea which makes it vegetable-based. It is dissimilar to most sources of protein because of its very high Glutamine and Arginine, and low-fat content, making it an ideal blend with whey. Genus protein is made of high-quality protein that&rsquo;s easily digestible and has a great taste.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Soy protein is avoided by most bodybuilders because of its estrogenic hormonal agents and its very low protein quality. These hormonal agents act like the female hormone estrogen which reduces muscle mass and promotes fat formation.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">The best protein shake would be a blend of whey protein and genus protein. This combination provides a better digestibility factor than a whey-alone product.&nbsp; With whey&rsquo;s high branched chain amino acid content and genus protein&rsquo;s generous amounts of Glutamine and Arginine, bodybuilders can assure themselves of a high-performance drink for bulkier muscles and improved athletic performance.&nbsp;</span></p>\r\n','/post_img/','2012-06-18 01:53:58','2012-07-04 04:45:05',NULL,1),(19,5,17,'published','WELCOME TO PURE RESULTS','<p>\r\n	Thank you for coming to my website Pure Results.&nbsp; The Pure Results supplement line was an accumulation of study, hard work and attention to detail which I now present to you.&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size:16px;\">I am rated one of the top trainers in North America. I can be found regularly in issues of Men&rsquo;s Fitness magazine teaching America new exercises and how to work out safely and effectively.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">I am also the Co-Founder of a New York City based not-for-profit Get Focused Foundation, an organization dedicated to strengthening communities, empowering minds and bodies and promoting healthy changes by providing positive solutions to the obesity epidemic in young adults. Get Focused Foundation creates a variety of signature programs and innovative events that help support young people and their families and recently responsible for creating the workout program for the Police Athletic League (PAL).</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">He was recently selected as 1 of 2 personal trainers in New York City to be featured on the nationally televised MTV show I Used To Be Fat, a weight loss show centered around childhood obesity in 2011. Yusuf &lsquo;s clients range from top executives from Fortune 500 companies, to sports clientele and entertainment celebrities and even individuals simply looking to maximize their time in the gym. Yusuf&rsquo;s passion for fitness, combined with his understanding of both individual goals and his keen understanding of anatomy has helped him create some of the most comprehensive training programs to date.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Of Panamanian and African-American descent, I was born and raised in New York City&rsquo;s Washington Heights. At the urging of his mother, Alma Oglivie, Yusuf was enrolled in many different athletic programs such as tae kwon do, hockey, swimming, football and gymnastics. Without much of a paternal presence, his mother knew that she needed a firm hand in his upbringing to guide him away from rampant drug use that plagued his neighborhood. It was a wise decision on her behalf. I was introduced to Body Sculpt of America and its founder Vince Ferguson. Ferguson established a not-for-profit health and fitness organization, whose purpose was to educate parents and children about childhood obesity and offer healthy lifestyle alternatives, particularly in physical fitness and nutrition. Thanks to Ferguson, I developed a passion for fitness and exercise.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">I am also the owner and founder of &ldquo;YM FITNESS&rdquo;, a growing multifaceted enterprise offering personal training sessions and specialty workshops for professional trainers.</span></p>\r\n<p>\r\n	<span style=\"font-size:16px;\">Through my connections with various nutritionists, scientists, bodybuilders, doctors and fitness enthusiasts, I bring to you Pure Results.&nbsp; For a pure you.&nbsp;</span></p>\r\n','/post_img/','2012-07-04 03:53:10','2012-07-04 04:44:50',NULL,1),(20,5,15,'published','PROTEIN PANCAKES','<p>\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \">\r\n	<span style=\"font-size:16px;\">A delicious repice for getting your morning protein into your body. &nbsp;</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \">\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \">\r\n	<span style=\"font-size:16px;\"><strong><span style=\"font-family:arial,helvetica,sans-serif;\">INGREDIENTS</span></strong></span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \">\r\n	&nbsp;</p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-