size: 12px; text-decoration: none; \" />\r\n	<span style=\"font-size:16px;\">5 ice cubes</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \">\r\n	<br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \" />\r\n	<span style=\"font-size:16px;\">1/2 cup of water</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \">\r\n	<br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \" />\r\n	<span style=\"font-size:16px;\">1 spoonful of instant coffee (caffeinated or decaf)</span></p>\r\n<p style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \">\r\n	<br style=\"margin-top: 0px; margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding-top: 0px; padding-right: 0px; padding-bottom: 0px; padding-left: 0px; outline-style: none; font-family: Arial, sans-serif; font-size: 12px; text-decoration: none; \" />\r\n	<span style=\"font-size:16px;\">Mix ingredients in blender</span></p>\r\n','/post_img/','2012-07-04 04:12:12','2012-07-05 12:41:08',NULL,1),(22,5,16,'published','SUCCESS STORY:  MARGIE PRADO','<p>\r\n	<span style=\"font-size:16px;\"><span style=\"font-family:arial,helvetica,sans-serif;\">My biggest accomplishment is taking a walk on the wild side by putting some red color in my hair. The transformation I need and want for my body won&rsquo;t be done in 2 weeks but I am living proof how much a person can do in only fourteen days when you stick to a diet and workout regimen that you don&rsquo;t even want to do for fourteen hours because it&rsquo;s so unpleasant. They say a photograph is worth a thousand words. &nbsp;I believe it. &nbsp;I &nbsp;have nothing else to say right now, just look at this!!!</span></span></p>\r\n','/post_img/','2012-07-04 04:44:11','2012-07-04 04:47:05',NULL,1);
