INSERT INTO `Product` VALUES (1,'Pure Results Multi-Vitamin','Multi-vitamin complex','<p>\r\n	<span style=\"font-size:12px;\">There is really no such thing as a complete 1-A-Day formula&mdash;they are usually lack sufficient levels of key nutrients such as Vitamin C and E, B-Complex vitamins and important minerals such as calcium and magnesium. Furthermore, nearly all of the Vitamin C and B-Complex can be used up by the body within a matter of hours after taking the single tablet. Formulas that are designed to be taken in doses of two or more tablets daily help correct this problem&mdash;by taking one tablet with each meal, nutrients are being consistently replaced as the body metabolizes them. Pure Results Multi-Vitamin is one of the most complete 3-A-Day formulas on the market providing a high potency blend of vitamins and minerals along with a complete food based complex including fruit and vegetable blends and spirulina. Also included are powerful antioxidants such as green tea, grape seed and red raspberry in addition to an impressive list of herbs and enzymes.</span></p>\r\n','24.99','2012-05-23 05:04:54','2012-07-03 00:41:48','0000-00-00 00:00:00',1),(2,'Pure Results Protein Powder','10 Sources of','<p>\r\n	Bioengineered with 10 Protein Sources to Prove a Multi-Stage Release of Amino Acids into the Blood Stream!</p>\r\n<p>\r\n	Fortified with Extra Branched Chain Amino Acids and L-Glutamine for Increased Performance and Decreased Recovery Time!</p>\r\n<div>\r\n	Includes Lactoferrin and Colostrum to Support the Immune System!</div>\r\n','39.99','2012-05-23 05:07:02','2012-07-03 08:21:22','0000-00-00 00:00:00',1),(3,'Pure Results Extreme Fat Burner','Extreme','<p>\r\n	<font class=\"Apple-style-span\" color=\"#000000\" face=\"arial, helvetica, sans-serif\">The perfect compliment to a sensible diet and exercise program, Pure Results Extreme Fat Burner is formulated to help increase energy and burn calories. In addition to more than 200mg of natural Caffeine per capsule from Guarana, Cha de Bugre, and Caffeine Anhydrous,&nbsp;Pure Results Extreme Fat Burner&nbsp;also contains Hoodia Cactus which is renowned for its effects on the appetite. Chromium Picolinate (Chromax) and Banaba Extract make up part of the&nbsp;Pure Results Extreme Fat Burner&nbsp;formula for their benefits in helping to regulate blood sugar which, in turn, can play a part in reducing food cravings. Green Tea and one of its natural constituents, L-Theanine, are present to help increase calorie burning. Each capsule of&nbsp;Pure Results Extreme Fat Burner&nbsp;contains 50mg of Theobromine, a natural ingredient found in chocolate which acts as natural diuretic and mild stimulant. Also included is Maca Extract which is also thought to act as a mild natural stimulant and Magnolia Bark Extract for its possible effects in helping to lower Cortisol levels which can lead to increased fat burning. Rounding out the&nbsp;Pure Results Extreme Fat Burner&nbsp;formula are Guggulsterone thought to have an effect of fat metabolism and Gluccomannon, one of the most effective fibers available.&nbsp;Pure Results Extreme Fat Burner&nbsp;is so powerful that the suggested use if only 1 to 2 capsules daily&mdash;1 capsule taken early morning and another, if needed, early afternoon.</font></p>\r\n','34.99','2012-05-23 21:44:22','2012-07-03 19:47:11','0000-00-00 00:00:00',1),(4,'Hemp Protien','Product','<p>\r\n	test</p>\r\n','50.00','2012-05-23 21:44:32','2012-06-07 03:41:58','2012-06-07 03:41:58',0);
